      "key": "v-499ef33c",
      "path": "/pages/9ae0bd/",
      "excerpt": "<p>写文章时，大概的流程是这样的：</p>\n<p>1.首先是创建<code>.md</code>文件，如果在结构化目录下则<strong>需要</strong>添加相应的序号，在碎片化博文目录<code>_posts</code>下<strong>不需要</strong>添加序号，文件名填写文章的标题。</p>\n<p>2.如果你想手动指定文章的分类、标签，则需要在头部front matter填写相应的字段。一般情况下不需要再填写其他字段。不想手动指定分类和标签也可以省略这一步。</p>\n<!--beforebegin--><div class=\"language-yaml line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-yaml\"><code><span class=\"token punctuation\">---</span>\n<span class=\"token key atrule\">categories</span><span class=\"token punctuation\">:</span> \n  <span class=\"token punctuation\">-</span> 分类1\n<span class=\"token key atrule\">tags</span><span class=\"token punctuation\">:</span> \n  <span class=\"token punctuation\">-</span> 标签1\n  <span class=\"token punctuation\">-</span> 标签2\n<span class=\"token punctuation\">---</span>\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br><span class=\"line-number\">2</span><br><span class=\"line-number\">3</span><br><span class=\"line-number\">4</span><br><span class=\"line-number\">5</span><br><span class=\"line-number\">6</span><br><span class=\"line-number\">7</span><br></div><!--beforeend--></div><!--afterend--><p>3.<strong>关于一级标题</strong>，即markdown中的一级标题(<code># 标题</code>)，你可以写也可以不写，在页面中实际显示的文章标题是取自front matter中的<code>title</code>，然后把<code>.md</code>中的一级标题隐藏了。</p>\n<blockquote>\n<p>这样做即可以保留本地文件的一级标题，也可以兼容线上页面的标题。\n同时，对于在新建<code>.md</code>文件时已经输入了一次标题在文件名，不想在文档中重复输入一次标题的，也是可以实现的。</p>\n</blockquote>\n<p>4.<strong>关于文章摘要</strong>，你想在首先文章列表中显示摘要时可以在合适的位置添加一个`</p>\n"
